-- ----------------------------
-- Procedure structure for PCD_DEPT_DATA
-- ----------------------------
DROP PROCEDURE IF EXISTS `PCD_DEPT_DATA`;
DELIMITER ;;
CREATE DEFINER=`yxzt_datacloud_test`@`%` PROCEDURE `PCD_DEPT_DATA`(IN param VARCHAR (100),
  IN numcolumn VARCHAR (16))
    READS SQL DATA
BEGIN

SET @SQL = NULL ;
IF param IS NULL THEN

SET @deptname = '' ;
ELSE

SET @deptname = param ;
END
IF ;
IF numcolumn IS NOT NULL AND numcolumn <> '' THEN

SET @numcolumn = numcolumn ;
ELSE

SET @numcolumn = 'WEEK_NUM' ;
END
IF ; SELECT
  GROUP_CONCAT(
    DISTINCT CONCAT(
      'MAX(IF(dc.DATA_CONFIG_ID = ''',
      dc.DATA_CONFIG_ID,
      ''', ds.',
      @numcolumn,
      ', 0)) AS ''',
      dc.DATA_CONFIG_ID,
      ''''
    )
  ) INTO @SQL
FROM
  DATA_CONFIG dc WHERE dc.DELETE_FLAG = '0';
SET @SQL = CONCAT(
  'SELECT sd.DEPT_NAME, t.* FROM (',
  'SELECT ds.DEPT_CODE, SUM(dst.TOTAL_NUM) AS TOTAL_NUM, ',
  @SQL,
  ' FROM DATA_STATISTICS ds
    LEFT JOIN DATA_TYPE_SOURCE_REL dtsr ON ds.TABLE_ID = dtsr.TABLE_ID
    LEFT JOIN DATA_TYPE dt ON dtsr.DATA_TYPE_ID = dt.DATA_TYPE_ID
    LEFT JOIN DATA_CONFIG dc ON dt.DATA_CONFIG_ID = dc.DATA_CONFIG_ID
    RIGHT JOIN (',
  ' SELECT DEPT_CODE, MAX(STATISTICS_DATE) AS LAST_DATE,SUM(DAY_NUM) AS TOTAL_NUM FROM DATA_STATISTICS GROUP BY DEPT_CODE',
  ' ) dst ON ( dst.DEPT_CODE = ds.DEPT_CODE AND dst.LAST_DATE = ds.STATISTICS_DATE ) GROUP BY ds.DEPT_CODE
    ) t LEFT JOIN SYS_DEPARTMENT sd ON sd.DEPT_CODE = t.DEPT_CODE WHERE sd.DEPT_NAME like ''%',
  @deptname,
  '%'' '
) ; PREPARE stmt
FROM
  @SQL ; EXECUTE stmt ; DEALLOCATE PREPARE stmt ;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for PCD_GRIDER_DATA
-- ----------------------------
DROP PROCEDURE IF EXISTS `PCD_GRIDER_DATA`;
DELIMITER ;;
CREATE DEFINER=`yxzt_datacloud_test`@`%` PROCEDURE `PCD_GRIDER_DATA`(IN param VARCHAR (100),
  IN numcolumn VARCHAR (16))
    READS SQL DATA
BEGIN

SET @SQL = NULL ;
IF param IS NULL THEN

SET @deptname = '' ;
ELSE

SET @deptname = param ;
END
IF ;
IF numcolumn IS NOT NULL AND numcolumn <> '' THEN

SET @numcolumn = numcolumn ;
ELSE

SET @numcolumn = 'WEEK_NUM' ;
END
IF ; SELECT
  GROUP_CONCAT(
    DISTINCT CONCAT(
      'MAX(IF(dc.DATA_CONFIG_ID = ''',
      dc.DATA_CONFIG_ID,
      ''', ds.',
      @numcolumn,
      ', 0)) AS ''',
      dc.DATA_CONFIG_ID,
      ''''
    )
  ) INTO @SQL
FROM
  DATA_CONFIG dc WHERE dc.DELETE_FLAG = '0';
SET @SQL = CONCAT(
  'SELECT sd.DEPT_NAME, t.* FROM (',
  'SELECT ds.DEPT_CODE, ds.GRIDER_CODE, SUM(dst.TOTAL_NUM) AS TOTAL_NUM, ',
  @SQL,
  ' FROM DATA_STATISTICS ds
    LEFT JOIN DATA_TYPE_SOURCE_REL dtsr ON ds.TABLE_ID = dtsr.TABLE_ID
    LEFT JOIN DATA_TYPE dt ON dtsr.DATA_TYPE_ID = dt.DATA_TYPE_ID
    LEFT JOIN DATA_CONFIG dc ON dt.DATA_CONFIG_ID = dc.DATA_CONFIG_ID
    RIGHT JOIN (',
  ' SELECT DEPT_CODE, MAX(STATISTICS_DATE) AS LAST_DATE,SUM(DAY_NUM) AS TOTAL_NUM FROM DATA_STATISTICS GROUP BY DEPT_CODE, GRIDER_CODE',
  ' ) dst ON ( dst.DEPT_CODE = ds.DEPT_CODE AND dst.LAST_DATE = ds.STATISTICS_DATE ) GROUP BY ds.DEPT_CODE, ds.GRIDER_CODE
    ) t LEFT JOIN SYS_DEPARTMENT sd ON sd.DEPT_CODE = t.DEPT_CODE WHERE sd.DEPT_NAME like ''%',
  @deptname,
  '%'' OR t.GRIDER_CODE LIKE ''%',
  @deptname,
  '%'' '
) ; PREPARE stmt
FROM
  @SQL ; EXECUTE stmt ; DEALLOCATE PREPARE stmt ;
END
;;
DELIMITER ;
